import React, { Component } from 'react'; 
import NavBar from './NavBar.js'; 
import AddUser from './AddUser.js';
class Users extends Component{ 


render(){ 
  return (
    <div>
        {/* <NavBar/>  */} 
        <div className="container"> 
          <div className="row">
            <div className="col-12">
              <AddUser/>
            </div>
          </div> 
        </div>
        
        
    
    </div>
  );
}



} 

export default Users;
